export default function Login() {
  return (
    <div>
      <div
        style={{
          display: "flex",
        }}
      >
        <img
          style={{
            height: "25px",
            width: "200px",
            marginTop: "20px",
            marginLeft: "20px",
            // border:"1px solid black"
          }}
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/ac/Semrush_logo.svg/2560px-Semrush_logo.svg.png"
          alt="semrush logo"
        />
      </div>
      <div
        style={{
          border: "1px solid black",
          height: "500px",
          width: "400px",
          textAlign: "left",
        }}
      >
        <h2
          style={{
            fontSize: "26px",
          }}
        >
          Log in
        </h2>
        <button
          style={{
            textDecoration: "none",
          }}
        >
          <img
          style={{
            marginRight:"40px",
            marginLeft:"10px",
          }}
            src="https://www.semrush.com/static/images/IconGoogle.840359a84e4fa263c9995938755cb02f.svg"
            alt="google"
          />{" "}
          Log in with Google
        </button>
      </div>
    </div>
  );
}
